(2504, 4152, '_form', '<p>Nombre (requerido)<br />\n    [text* your-name] </p>\n\n<p>Correo electrónico (requerido)<br />\n    [email* your-email] </p>\n\n<p>Asunto<br />\n    [text your-subject] </p>\n\n<p>Mensaje<br />\n    [textarea your-message] </p>\n\n<p>[submit "Enviar"]</p>'),
(2505, 4152, '_mail', 'a:8:{s:7:"subject";s:14:"[your-subject]";s:6:"sender";s:37:"[your-name] <morgadoluengo@gmail.com>";s:4:"body";s:200:"De: [your-name] <[your-email]>\nAsunto: [your-subject]\n\nCuerpo del mensaje:\n[your-message]\n\n--\nEste mensaje se ha enviado vía formulario de contacto desde Pension Adeco (http://localhost/pensionadeco)";s:9:"recipient";s:23:"morgadoluengo@gmail.com";s:18:"additional_headers";s:22:"Reply-To: [your-email]";s:11:"attachments";s:0:"";s:8:"use_html";i:0;s:13:"exclude_blank";i:0;}'),
(2506, 4152, '_mail_2', 'a:9:{s:6:"active";b:0;s:7:"subject";s:14:"[your-subject]";s:6:"sender";s:39:"Pension Adeco <morgadoluengo@gmail.com>";s:4:"body";s:145:"Cuerpo del mensaje:\n[your-message]\n\n--\nEste mensaje se ha enviado vía formulario de contacto desde Pension Adeco (http://localhost/pensionadeco)";s:9:"recipient";s:12:"[your-email]";s:18:"additional_headers";s:33:"Reply-To: morgadoluengo@gmail.com";s:11:"attachments";s:0:"";s:8:"use_html";i:0;s:13:"exclude_blank";i:0;}'),
(2507, 4152, '_messages', 'a:8:{s:12:"mail_sent_ok";s:52:"Su mensaje se ha enviado con éxito. Muchas gracias.";s:12:"mail_sent_ng";s:110:"Falló el envío del mensaje. Por favor, inténtelo más tarde o contacte con el administrador por otro medio.";s:16:"validation_error";s:97:"Ocurrió un error de validación. Por favor, confirme los campos y envíe el formulario de nuevo.";s:4:"spam";s:110:"Falló el envío del mensaje. Por favor, inténtelo más tarde o contacte con el administrador por otro medio.";s:12:"accept_terms";s:61:"Por favor, acepte los términos y condiciones para continuar.";s:16:"invalid_required";s:39:"Por favor, complete el campo requerido.";s:16:"invalid_too_long";s:33:"Esta entrada es demasiado grande.";s:17:"invalid_too_short";s:32:"Esta entrada es demasiado corta.";}'),
