(1519, 1, '2013-12-20 19:34:28', '2013-12-20 19:34:28', '<h3>Post Format</h3>\nYou can use post format feature from WP in this theme. You can see example of result here > <a href="http://themes.goodlayers2.com/flawless/blog-full-with-right-sidebar/" target="_blank">http://themes.goodlayers2.com/flawless/blog-full-with-right-sidebar/</a>\n\n<a href="http://themes.goodlayers2.com/flawless/wp-content/uploads/2013/12/feature-13-1.jpg"><img src="http://themes.goodlayers2.com/flawless/wp-content/uploads/2013/12/feature-13-1.jpg" alt="feature-13-1" width="620" height="600" class="alignnone size-full wp-image-1520" /></a>', 'Post Format', '', 'publish', 'closed', 'open', '', 'post-format', '', '', '2013-12-20 19:34:28', '2013-12-20 19:34:28', '', 0, 'http://themes.goodlayers2.com/flawless/?page_id=1519', 0, 'page', '', 0),
(1522, 1, '2013-12-20 19:37:27', '2013-12-20 19:37:27', '<h3>Master Slider</h3>\n<span style="color: #444444;">Master Slider is a premium </span><strong style="color: #444444;">image and content slider</strong><span style="color: #444444;"> with </span><strong style="color: #444444;">super smooth hardware accelerated transitions</strong><span style="color: #444444;">. It supports </span><strong style="color: #444444;">touch navigation</strong><span style="color: #444444;"> with </span><strong style="color: #444444;">pure swipe gesture</strong><span style="color: #444444;"> that you have never experienced before. It’s a truly </span><strong style="color: #444444;">responsive</strong><span style="color: #444444;"> and </span><strong style="color: #444444;">device friendly</strong><span style="color: #444444;"> slider which works perfect in all major devices.</span>\n\n<a href="http://themes.goodlayers2.com/versatile/wp-content/uploads/2013/12/feature-master-slider.jpg"><img class="alignnone size-full wp-image-2681" src="http://themes.goodlayers2.com/versatile/wp-content/uploads/2013/12/feature-master-slider.jpg" alt="feature-master-slider" width="620" height="600" /></a>', 'Master Slider', '', 'publish', 'closed', 'open', '', 'layer-slider-2', '', '', '2013-12-20 19:37:27', '2013-12-20 19:37:27', '', 0, 'http://themes.goodlayers2.com/flawless/?page_id=1522', 0, 'page', '', 0),
(1525, 1, '2013-12-20 19:40:34', '2013-12-20 19:40:34', '<h3>Optimized Code & SEO</h3>\nWe reconstructed about how to use title. We use heading tag(H1,H2,H3,…) for title which is good practice for search engine site. Main contents are moved above sidebars(including both sidebar layout), now search engine will easily fine your main contents first. Also, ‘alt’ tag for images is supported. This is also help search engine to analyst your site easily. \n\n<a href="http://themes.goodlayers2.com/flawless/wp-content/uploads/2013/12/feature-15-1.jpg"><img src="http://themes.goodlayers2.com/flawless/wp-content/uploads/2013/12/feature-15-1.jpg" alt="feature-15-1" width="620" height="600" class="alignnone size-full wp-image-1526" /></a>', 'Optimized Code & SEO', '', 'publish', 'closed', 'open', '', 'optimized-code-seo', '', '', '2013-12-20 19:40:34', '2013-12-20 19:40:34', '', 0, 'http://themes.goodlayers2.com/flawless/?page_id=1525', 0, 'page', '', 0),
(1566, 1, '2013-12-21 05:03:33', '2013-12-21 05:03:33', '<h3>Scalable Container</h3>\nIf you like 960px, 1280px, 1400px.... It''s all good. You can put ANY number in this box.\n\n<a href="http://themes.goodlayers2.com/flawless/wp-content/uploads/2013/12/feature-17-1.jpg"><img class="alignnone size-full wp-image-1567" alt="feature-17-1" src="http://themes.goodlayers2.com/flawless/wp-content/uploads/2013/12/feature-17-1.jpg" width="620" height="600" /></a>', 'Scalable Container', '', 'publish', 'closed', 'open', '', 'scalable-container', '', '', '2013-12-21 05:03:33', '2013-12-21 05:03:33', '', 0, 'http://themes.goodlayers2.com/flawless/?page_id=1566', 0, 'page', '', 0),
